import React from 'react'
import images from './img.js'
import TouchUIDemo from './data.js'
import { PrimeReactProvider, PrimeReactContext } from 'primereact/api';
import { Button } from 'primereact/button';
function choise() {
  return (
<div class="container">
<div class="row">
<div class="col">
<img src="https://открыватор.москва/file/2015/10/karta-moskvi.jpg" height="180px" width="250px"/>
</div>
<div class="col">
<h5 class="card-title">Набережная</h5>
<p class="card-text"><img src={images.point} height="23px" width="23px"/> Адрес:</p>
<p class="card-text"><img src={images.cort} height="23px" width="23px"/> Грунт:</p>
<p class="card-text"><img src={images.sub} height="23px" width="23px"/> Метро:</p>
<button type="button" class="btn btn-outline-success">Я приду</button>
</div>
</div>
<br/>
<div class="row">
{ Button }
{TouchUIDemo()}
</div>
</div>

  );
}

export default choise
